import React from "react";

export default function formatDate(props) {
  console.log(props.date.getDay());
  let days = [
    "Sunday",
    "Monday",
    "Tuesday",
    "Wednesday",
    "Thursday",
    "Friday",
    "Saturday",
  ];
  let day = days[props.date.getDay()];
  return <div> {day} 12:03 </div>;
}
